import React from 'react';
import {Navbar} from './Components/navbar.jsx';
import './App.css';
import { Footer } from './Components/footer.jsx';

function Home() {
  return (
    <div className="App">
      <Navbar/>
      <Footer/>
    </div>
  );
}

function AppRouter() {
  return (
    <Router>
      <div>
        <Route path="/" exact component={Home} />
        <Route path="/photoshop/" component={Vehicles} />
        <Route path="/modeling/" component={Finance} />
        <Route path="/gamedev/" component={About} />
        <Route path="/contact/" component={Contact} />
      </div>
    </Router>
  );
}

export default AppRouter;
